import React from 'react'

function App(){

    const table = {
        width: '100%',
        borderCollapse: 'collapse'
    }

      
    
     

    const bioData = [
        {name: 'Jack', age: 24, language: 'English'},
        {name: 'James', age: 26, language: 'Russian'},
        {name: 'Rostov', age: 28, language: 'Spanish'}
    ]   
    console.warn(bioData)
return(
    <>
    <h1>Nested List With Nested Array</h1>
    
{
bioData.map((data)=>{
    return(
        <>
<table style={table}>
<tr>
    <td>{data.name}</td>
    <td>{data.age}</td>
    <td>{data.language}</td>

</tr>

</table>
</>
)
})

}
    </>
)
}

export default App
